description:
Category	Feature, Parody / Spoof

Director	Axel Braun
Starring	Stormy Daniels, Mick Blue, Anikka Albrite, Michael Vegas, Casey Calvert, Riley Steele, Claire Robbins, Jay Crew, Shayla Le Veaux

All Your Fears Are About To Come True.
Following the critical and commercial success of &quot;Snow White XXX: An Axel Braun Parody,&quot; Wicked Pictures proudly presents another classic fairy tale re-imagined by the legendary director. Featuring rising starlet Anikka Albrite as the doomed princess, and superstar Stormy Daniels in a powerhouse performance as Maleficent, &quot;Sleeping Beauty XXX: An Axel Braun Parody&quot; is a dark, sensual and enticing feature with all the amazing costumes, production values and hot sex that Braun's fans have come to expect from him.

